import React, { Component } from 'react';
import { GiArrowed } from 'react-icons/gi';

class TopNavLeftIcon extends Component {
    render(){
        return(
            <a href={this.props.href} title={this.props.title}>
                <this.props.name />
            </a>
        );
        }
}

export default TopNavLeftIcon;
